import { Component } from '@angular/core';

@Component({
  selector: 'app-list',
  templateUrl: './list.component.html',
  styleUrls: ['./list.component.css']
})
export class ListComponent {
  cars:string[] =['tesla','maruti'];
}
<h5>List</h5>
<ul>
    <li *ngFor="let carName for cars">{{carName}}</li>
</ul>
